import React from 'react'
import { Link } from 'react-router-dom';

const NavBar = () => {
  return (
    <div>
        <nav className='bg-indigo-700 w-full h-20 rounded-b-lg shadow-2xl shadow-slate-800'>
        <div className='container mx-auto'>
            <div className='sm:flex justify-center'>
                <Link to="#" className='text-white text-3xl font-semibold'>SG-Stores</Link>
            </div>        
        </div>
    </nav>
    </div>
  )
}

export default NavBar;
